import React from 'react';
import './splash.css';
import Title from './Title.js';
import ProfileImage from './ProfileImage.js';

const Splash = () => {
    return (
      <div className='main-div'>
        <div className="main-header">
          <ProfileImage />
            <div className="text-header">
            <Title />
          </div>
        </div>
      </div>
    );
  }

export default Splash;
